    Lidar Point Data of Southern California Coastline: Newport Beach to US/Mexican Border",nt"tracking_summary":
    {ntt"total": 5,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-09-26T21:51:40.650037",nt"name": "october-2003-lidar-point-data-of-southern-california-coastline-newport-beach-to-us-mexican-bord",nt"isopen":
    false,nt"url": null,nt"notes": "This data set contains lidar point data
    (Geodetic Coordinates) from a strip of Southern California coastline (including
    water, beach, cliffs, and top of cliffs) from Newport Beach to the US/Mexico border.
    The data set was created by combining data collected using an Optech Inc. Airborne
    Laser Terrain Mapper (ALTM) 1225 in combination with geodetic quality Global Positioning
    System (GPS) airborne and ground-based receivers. The Bureau of Economic Geology,
    the University of Texas at Austin owns and operates an ALTM 1225 system (serial
    number 99d118). The system was installed in a twin engine Partenavia P-68 (tail
    number N6602L) owned and operated by Aspen Helicopter, Inc. The lidar data set described
    by this document was collected on 24 and 25 October 2003; Julian Days 29703 and
    29803 (see Lineage, Source_Information, Source_Contribution for pass information).
    Conditions on both days were haze, low clouds, and smoke over Los Angeles and Camp
    Pendleton. 99d118 instrument settings for these flights were; laser pulse rate:
    25kHz, scanner rate: 26Hz, scan angle: +/- 20deg, beam divergence: narrow, altitude:
    1038-1106m AGL, and ground speed: 99-119kts. Three GPS base stations (Seal Beach,
    Dana Point, and Point Loma, see Lineage, Source_Information, Source_Contribution
    for coordinates) were operating during the survey. Data represented is all points
    including terrain, vegetation, and structures. This data also contains returns from
    the water surface. No processing has been done to remove returns from terrain, vegetation,
    structures or water surfaces.",nt"license_title": null,nt"extras": [{ntt"key":
